    when N < 32 - 7 ->
    dg_read_field_def_Token(Rest, N + 7, X bsl N + Acc,
			    F@_1, TrUserData);
dg_read_field_def_Token(<<0:1, X:7, Rest/binary>>, N,
			Acc, F@_1, TrUserData) ->
    Key = X bsl N + Acc,
    case Key of
      10 -> d_field_Token_value(Rest, 0, 0, F@_1, TrUserData);
      _ ->
	  case Key band 7 of
	    0 -> skip_varint_Token(Rest, 0, 0, F@_1, TrUserData);
	    1 -> skip_64_Token(Rest, 0, 0, F@_1, TrUserData);
	    2 ->
		skip_length_delimited_Token(Rest, 0, 0, F@_1,
					    TrUserData);
	    3 ->
		skip_group_Token(Rest, Key bsr 3, 0, F@_1, TrUserData);
	    5 -> skip_32_Token(Rest, 0, 0, F@_1, TrUserData)
	  end
    end;
dg_read_field_def_Token(<<>>, 0, 0, F@_1, _) ->
    #'Token'{value = F@_1}.

d_field_Token_value(<<1:1, X:7, Rest/binary>>, N, Acc,
		    F@_1, TrUserData)
    when N < 57 ->
    d_field_Token_value(Rest, N + 7, X bsl N + Acc, F@_1,
			TrUserData);
d_field_Token_value(<<0:1, X:7, Rest/binary>>, N, Acc,
		    _, TrUserData) ->
    {NewFValue, RestF} = begin
			   Len = X bsl N + Acc,
			   <<Utf8:Len/binary, Rest2/binary>> = Rest,
			   {id(unicode:characters_to_list(Utf8, unicode),
			       TrUserData),
			    Rest2}
			 end,
    dfp_read_field_def_Token(RestF, 0, 0, NewFValue,
			     TrUserData).

skip_varint_Token(<<1:1, _:7, Rest/binary>>, Z1, Z2,
		  F@_1, TrUserData) ->
    skip_varint_Token(Rest, Z1, Z2, F@_1, TrUserData);
skip_varint_Token(<<0:1, _:7, Rest/binary>>, Z1, Z2,
		  F@_1, TrUserData) ->
    dfp_read_field_def_Token(Rest, Z1, Z2, F@_1,
			     TrUserData).

skip_length_delimited_Token(<<1:1, X:7, Rest/binary>>,
			    N, Acc, F@_1, TrUserData)
    when N < 57 ->
    skip_length_delimited_Token(Rest, N + 7, X bsl N + Acc,
				F@_1, TrUserData);
skip_length_delimited_Token(<<0:1, X:7, Rest/binary>>,
			    N, Acc, F@_1, TrUserData) ->
    Length = X bsl N + Acc,
    <<_:Length/binary, Rest2/binary>> = Rest,
    dfp_read_field_def_Token(Rest2, 0, 0, F@_1, TrUserData).

skip_group_Token(Bin, FNum, Z2, F@_1, TrUserData) ->
    {_, Rest} = read_group(Bin, FNum),
    dfp_read_field_def_Token(Rest, 0, Z2, F@_1, TrUserData).

skip_32_Token(<<_:32, Rest/binary>>, Z1, Z2, F@_1,
	      TrUserData) ->
    dfp_read_field_def_Token(Rest, Z1, Z2, F@_1,
			     TrUserData).

skip_64_Token(<<_:64, Rest/binary>>, Z1, Z2, F@_1,
	      TrUserData) ->
    dfp_read_field_def_Token(Rest, Z1, Z2, F@_1,
			     TrUserData).

decode_msg_UserID(Bin, TrUserData) ->
    dfp_read_field_def_UserID(Bin, 0, 0, id([], TrUserData),
