skip_32_UserID(<<_:32, Rest/binary>>, Z1, Z2, F@_1,
	       TrUserData) ->
    dfp_read_field_def_UserID(Rest, Z1, Z2, F@_1,
			      TrUserData).

skip_64_UserID(<<_:64, Rest/binary>>, Z1, Z2, F@_1,
	       TrUserData) ->
    dfp_read_field_def_UserID(Rest, Z1, Z2, F@_1,
			      TrUserData).

read_group(Bin, FieldNum) ->
    {NumBytes, EndTagLen} = read_gr_b(Bin, 0, 0, 0, 0, FieldNum),
    <<Group:NumBytes/binary, _:EndTagLen/binary, Rest/binary>> = Bin,
    {Group, Rest}.

%% Like skipping over fields, but record the total length,
%% Each field is <(FieldNum bsl 3) bor FieldType> ++ <FieldValue>
%% Record the length because varints may be non-optimally encoded.
%%
%% Groups can be nested, but assume the same FieldNum cannot be nested
%% because group field numbers are shared with the rest of the fields
%% numbers. Thus we can search just for an group-end with the same
%% field number.
%%
%% (The only time the same group field number could occur would
%% be in a nested sub message, but then it would be inside a
%% length-delimited entry, which we skip-read by length.)
read_gr_b(<<1:1, X:7, Tl/binary>>, N, Acc, NumBytes, TagLen, FieldNum)
  when N < (32-7) ->
    read_gr_b(Tl, N+7, X bsl N + Acc, NumBytes, TagLen+1, FieldNum);
read_gr_b(<<0:1, X:7, Tl/binary>>, N, Acc, NumBytes, TagLen,
          FieldNum) ->
    Key = X bsl N + Acc,
    TagLen1 = TagLen + 1,
    case {Key bsr 3, Key band 7} of
        {FieldNum, 4} -> % 4 = group_end
            {NumBytes, TagLen1};
        {_, 0} -> % 0 = varint
            read_gr_vi(Tl, 0, NumBytes + TagLen1, FieldNum);
        {_, 1} -> % 1 = bits64
            <<_:64, Tl2/binary>> = Tl,
            read_gr_b(Tl2, 0, 0, NumBytes + TagLen1 + 8, 0, FieldNum);
        {_, 2} -> % 2 = length_delimited
            read_gr_ld(Tl, 0, 0, NumBytes + TagLen1, FieldNum);
        {_, 3} -> % 3 = group_start
            read_gr_b(Tl, 0, 0, NumBytes + TagLen1, 0, FieldNum);
        {_, 4} -> % 4 = group_end
            read_gr_b(Tl, 0, 0, NumBytes + TagLen1, 0, FieldNum);
        {_, 5} -> % 5 = bits32
            <<_:32, Tl2/binary>> = Tl,
            read_gr_b(Tl2, 0, 0, NumBytes + TagLen1 + 4, 0, FieldNum)
    end.

read_gr_vi(<<1:1, _:7, Tl/binary>>, N, NumBytes, FieldNum)
  when N < (64-7) ->
    read_gr_vi(Tl, N+7, NumBytes+1, FieldNum);
read_gr_vi(<<0:1, _:7, Tl/binary>>, _, NumBytes, FieldNum) ->
    read_gr_b(Tl, 0, 0, NumBytes+1, 0, FieldNum).

read_gr_ld(<<1:1, X:7, Tl/binary>>, N, Acc, NumBytes, FieldNum)
  when N < (64-7) ->
    read_gr_ld(Tl, N+7, X bsl N + Acc, NumBytes+1, FieldNum);
read_gr_ld(<<0:1, X:7, Tl/binary>>, N, Acc, NumBytes, FieldNum) ->
    Len = X bsl N + Acc,
    NumBytes1 = NumBytes + 1,
    <<_:Len/binary, Tl2/binary>> = Tl,
    read_gr_b(Tl2, 0, 0, NumBytes1 + Len, 0, FieldNum).

merge_msgs(Prev, New)
    when element(1, Prev) =:= element(1, New) ->
    merge_msgs(Prev, New, element(1, Prev), []).

merge_msgs(Prev, New, MsgName) when is_atom(MsgName) ->
    merge_msgs(Prev, New, MsgName, []);
merge_msgs(Prev, New, Opts)
    when element(1, Prev) =:= element(1, New),
	 is_list(Opts) ->
    merge_msgs(Prev, New, element(1, Prev), Opts).

merge_msgs(Prev, New, MsgName, Opts) ->
    TrUserData = proplists:get_value(user_data, Opts),
    case MsgName of
      'AccessReq' ->
	  merge_msg_AccessReq(Prev, New, TrUserData);
      'ThingID' -> merge_msg_ThingID(Prev, New, TrUserData);
      'Token' -> merge_msg_Token(Prev, New, TrUserData);
      'UserID' -> merge_msg_UserID(Prev, New, TrUserData)
    end.

-compile({nowarn_unused_function,merge_msg_AccessReq/3}).
merge_msg_AccessReq(#'AccessReq'{token = PFtoken,
				 chanID = PFchanID},
		    #'AccessReq'{token = NFtoken, chanID = NFchanID}, _) ->
    #'AccessReq'{token =
		     if NFtoken =:= undefined -> PFtoken;
			true -> NFtoken
		     end,
		 chanID =
		     if NFchanID =:= undefined -> PFchanID;
			true -> NFchanID
		     end}.

-compile({nowarn_unused_function,merge_msg_ThingID/3}).
merge_msg_ThingID(#'ThingID'{value = PFvalue},
		  #'ThingID'{value = NFvalue}, _) ->
    #'ThingID'{value =
		   if NFvalue =:= undefined -> PFvalue;
		      true -> NFvalue
		   end}.

-compile({nowarn_unused_function,merge_msg_Token/3}).
merge_msg_Token(#'Token'{value = PFvalue},
		#'Token'{value = NFvalue}, _) ->
    #'Token'{value =
		 if NFvalue =:= undefined -> PFvalue;
		    true -> NFvalue
		 end}.

-compile({nowarn_unused_function,merge_msg_UserID/3}).
merge_msg_UserID(#'UserID'{value = PFvalue},
		 #'UserID'{value = NFvalue}, _) ->
    #'UserID'{value =
		  if NFvalue =:= undefined -> PFvalue;
		     true -> NFvalue
		  end}.


verify_msg(Msg) when tuple_size(Msg) >= 1 ->
    verify_msg(Msg, element(1, Msg), []);
verify_msg(X) ->
    mk_type_error(not_a_known_message, X, []).

verify_msg(Msg, MsgName) when is_atom(MsgName) ->
    verify_msg(Msg, MsgName, []);
verify_msg(Msg, Opts) when tuple_size(Msg) >= 1 ->
    verify_msg(Msg, element(1, Msg), Opts);
verify_msg(X, _Opts) ->
    mk_type_error(not_a_known_message, X, []).

verify_msg(Msg, MsgName, Opts) ->
    TrUserData = proplists:get_value(user_data, Opts),
    case MsgName of
      'AccessReq' ->
	  v_msg_AccessReq(Msg, [MsgName], TrUserData);
      'ThingID' -> v_msg_ThingID(Msg, [MsgName], TrUserData);
      'Token' -> v_msg_Token(Msg, [MsgName], TrUserData);
      'UserID' -> v_msg_UserID(Msg, [MsgName], TrUserData);
      _ -> mk_type_error(not_a_known_message, Msg, [])
    end.


-compile({nowarn_unused_function,v_msg_AccessReq/3}).
-dialyzer({nowarn_function,v_msg_AccessReq/3}).
v_msg_AccessReq(#'AccessReq'{token = F1, chanID = F2},
		Path, TrUserData) ->
    if F1 == undefined -> ok;
       true -> v_type_string(F1, [token | Path], TrUserData)
    end,
    if F2 == undefined -> ok;
       true -> v_type_string(F2, [chanID | Path], TrUserData)
    end,
    ok;
v_msg_AccessReq(X, Path, _TrUserData) ->
    mk_type_error({expected_msg, 'AccessReq'}, X, Path).

-compile({nowarn_unused_function,v_msg_ThingID/3}).
-dialyzer({nowarn_function,v_msg_ThingID/3}).
v_msg_ThingID(#'ThingID'{value = F1}, Path,
	      TrUserData) ->
    if F1 == undefined -> ok;
       true -> v_type_string(F1, [value | Path], TrUserData)
    end,
    ok;
v_msg_ThingID(X, Path, _TrUserData) ->
    mk_type_error({expected_msg, 'ThingID'}, X, Path).

-compile({nowarn_unused_function,v_msg_Token/3}).
-dialyzer({nowarn_function,v_msg_Token/3}).
v_msg_Token(#'Token'{value = F1}, Path, TrUserData) ->
    if F1 == undefined -> ok;
       true -> v_type_string(F1, [value | Path], TrUserData)
    end,
    ok;
v_msg_Token(X, Path, _TrUserData) ->
    mk_type_error({expected_msg, 'Token'}, X, Path).

-compile({nowarn_unused_function,v_msg_UserID/3}).
-dialyzer({nowarn_function,v_msg_UserID/3}).
v_msg_UserID(#'UserID'{value = F1}, Path, TrUserData) ->
    if F1 == undefined -> ok;
       true -> v_type_string(F1, [value | Path], TrUserData)
    end,
    ok;
v_msg_UserID(X, Path, _TrUserData) ->
    mk_type_error({expected_msg, 'UserID'}, X, Path).

-compile({nowarn_unused_function,v_type_string/3}).
-dialyzer({nowarn_function,v_type_string/3}).
v_type_string(S, Path, _TrUserData)
    when is_list(S); is_binary(S) ->
    try unicode:characters_to_binary(S) of
      B when is_binary(B) -> ok;
      {error, _, _} ->
	  mk_type_error(bad_unicode_string, S, Path)
    catch
      error:badarg ->
	  mk_type_error(bad_unicode_string, S, Path)
    end;
v_type_string(X, Path, _TrUserData) ->
    mk_type_error(bad_unicode_string, X, Path).

-compile({nowarn_unused_function,mk_type_error/3}).
-spec mk_type_error(_, _, list()) -> no_return().
mk_type_error(Error, ValueSeen, Path) ->
    Path2 = prettify_path(Path),
    erlang:error({gpb_type_error,
		  {Error, [{value, ValueSeen}, {path, Path2}]}}).


-compile({nowarn_unused_function,prettify_path/1}).
-dialyzer({nowarn_function,prettify_path/1}).
prettify_path([]) -> top_level;
prettify_path(PathR) ->
    list_to_atom(lists:append(lists:join(".",
					 lists:map(fun atom_to_list/1,
						   lists:reverse(PathR))))).


-compile({nowarn_unused_function,id/2}).
-compile({inline,id/2}).
id(X, _TrUserData) -> X.

-compile({nowarn_unused_function,v_ok/3}).
-compile({inline,v_ok/3}).
v_ok(_Value, _Path, _TrUserData) -> ok.

-compile({nowarn_unused_function,m_overwrite/3}).
-compile({inline,m_overwrite/3}).
m_overwrite(_Prev, New, _TrUserData) -> New.

-compile({nowarn_unused_function,cons/3}).
-compile({inline,cons/3}).
cons(Elem, Acc, _TrUserData) -> [Elem | Acc].

-compile({nowarn_unused_function,lists_reverse/2}).
-compile({inline,lists_reverse/2}).
'lists_reverse'(L, _TrUserData) -> lists:reverse(L).
-compile({nowarn_unused_function,'erlang_++'/3}).
-compile({inline,'erlang_++'/3}).
'erlang_++'(A, B, _TrUserData) -> A ++ B.


