%% Convert a a fully qualified (ie with package name) service name
%% as a binary to a service name as an atom.
fqbin_to_service_name(<<"mainflux.ThingsService">>) -> 'ThingsService';
fqbin_to_service_name(<<"mainflux.UsersService">>) -> 'UsersService';
fqbin_to_service_name(X) ->
    error({gpb_error, {badservice, X}}).


%% Convert a service name as an atom to a fully qualified
%% (ie with package name) name as a binary.
service_name_to_fqbin('ThingsService') -> <<"mainflux.ThingsService">>;
service_name_to_fqbin('UsersService') -> <<"mainflux.UsersService">>;
service_name_to_fqbin(X) ->
    error({gpb_error, {badservice, X}}).


%% Convert a a fully qualified (ie with package name) service name
%% and an rpc name, both as binaries to a service name and an rpc
%% name, as atoms.
fqbins_to_service_and_rpc_name(<<"mainflux.ThingsService">>, <<"CanAccess">>) ->
    {'ThingsService', 'CanAccess'};
fqbins_to_service_and_rpc_name(<<"mainflux.ThingsService">>, <<"Identify">>) ->
    {'ThingsService', 'Identify'};
fqbins_to_service_and_rpc_name(<<"mainflux.UsersService">>, <<"Identify">>) ->
    {'UsersService', 'Identify'};
fqbins_to_service_and_rpc_name(S, R) ->
    error({gpb_error, {badservice_or_rpc, {S, R}}}).


%% Convert a service name and an rpc name, both as atoms,
%% to a fully qualified (ie with package name) service name and
%% an rpc name as binaries.
service_and_rpc_name_to_fqbins('ThingsService',
			       'CanAccess') ->
    {<<"mainflux.ThingsService">>, <<"CanAccess">>};
service_and_rpc_name_to_fqbins('ThingsService',
			       'Identify') ->
    {<<"mainflux.ThingsService">>, <<"Identify">>};
service_and_rpc_name_to_fqbins('UsersService',
			       'Identify') ->
    {<<"mainflux.UsersService">>, <<"Identify">>};
service_and_rpc_name_to_fqbins(S, R) ->
    error({gpb_error, {badservice_or_rpc, {S, R}}}).


fqbin_to_msg_name(<<"mainflux.AccessReq">>) -> 'AccessReq';
fqbin_to_msg_name(<<"mainflux.ThingID">>) -> 'ThingID';
fqbin_to_msg_name(<<"mainflux.Token">>) -> 'Token';
fqbin_to_msg_name(<<"mainflux.UserID">>) -> 'UserID';
fqbin_to_msg_name(E) -> error({gpb_error, {badmsg, E}}).


msg_name_to_fqbin('AccessReq') -> <<"mainflux.AccessReq">>;
msg_name_to_fqbin('ThingID') -> <<"mainflux.ThingID">>;
msg_name_to_fqbin('Token') -> <<"mainflux.Token">>;
msg_name_to_fqbin('UserID') -> <<"mainflux.UserID">>;
msg_name_to_fqbin(E) -> error({gpb_error, {badmsg, E}}).


-spec fqbin_to_enum_name(_) -> no_return().
fqbin_to_enum_name(E) ->
    error({gpb_error, {badenum, E}}).


-spec enum_name_to_fqbin(_) -> no_return().
enum_name_to_fqbin(E) ->
    error({gpb_error, {badenum, E}}).


get_package_name() -> mainflux.


%% Whether or not the message names
%% are prepended with package name or not.
uses_packages() -> false.


source_basename() -> "internal.proto".


%% Retrieve all proto file names, also imported ones.
%% The order is top-down. The first element is always the main
%% source file. The files are returned with extension,
%% see get_all_proto_names/0 for a version that returns
%% the basenames sans extension
get_all_source_basenames() -> ["internal.proto"].


%% Retrieve all proto file names, also imported ones.
%% The order is top-down. The first element is always the main
%% source file. The files are returned sans .proto extension,
%% to make it easier to use them with the various get_xyz_containment
%% functions.
get_all_proto_names() -> ["internal"].


get_msg_containment("internal") ->
    ['AccessReq', 'ThingID', 'Token', 'UserID'];
get_msg_containment(P) ->
    error({gpb_error, {badproto, P}}).


get_pkg_containment("internal") -> undefined;
get_pkg_containment(P) ->
    error({gpb_error, {badproto, P}}).


get_service_containment("internal") ->
    ['ThingsService', 'UsersService'];
get_service_containment(P) ->
    error({gpb_error, {badproto, P}}).


get_rpc_containment("internal") ->
    [{'ThingsService', 'CanAccess'},
     {'ThingsService', 'Identify'},
     {'UsersService', 'Identify'}];
get_rpc_containment(P) ->
    error({gpb_error, {badproto, P}}).


get_enum_containment("internal") -> [];
get_enum_containment(P) ->
    error({gpb_error, {badproto, P}}).


get_proto_by_msg_name_as_fqbin(<<"mainflux.AccessReq">>) -> "internal";
get_proto_by_msg_name_as_fqbin(<<"mainflux.UserID">>) -> "internal";
get_proto_by_msg_name_as_fqbin(<<"mainflux.ThingID">>) -> "internal";
get_proto_by_msg_name_as_fqbin(<<"mainflux.Token">>) -> "internal";
get_proto_by_msg_name_as_fqbin(E) ->
    error({gpb_error, {badmsg, E}}).


get_proto_by_service_name_as_fqbin(<<"mainflux.UsersService">>) ->
    "internal";
get_proto_by_service_name_as_fqbin(<<"mainflux.ThingsService">>) ->
    "internal";
get_proto_by_service_name_as_fqbin(E) ->
    error({gpb_error, {badservice, E}}).


-spec get_proto_by_enum_name_as_fqbin(_) -> no_return().
get_proto_by_enum_name_as_fqbin(E) ->
    error({gpb_error, {badenum, E}}).


-spec get_protos_by_pkg_name_as_fqbin(_) -> no_return().
get_protos_by_pkg_name_as_fqbin(E) ->
    error({gpb_error, {badpkg, E}}).



gpb_version_as_string() ->
    "4.9.0".

gpb_version_as_list() ->
    [4,9,0].
